import React from 'react';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';
import StyleConfidentialityCenter from "./StyleConfidentialytiCenter";

const Confidentialitycenter = ()=>{
    return <View style ={StyleConfidentialityCenter.centerConteiner}>
       <Text>User</Text>
       <View style ={StyleConfidentialityCenter.buttonsConteiner}>   
            <TouchableOpacity style ={StyleConfidentialityCenter.centerButtons}><Text style ={StyleConfidentialityCenter.buttonText}>Blocked User</Text><TouchableOpacity style= {StyleConfidentialityCenter.backButton}><Text style ={StyleConfidentialityCenter.buttonText}>back</Text></TouchableOpacity></TouchableOpacity>
       </View>
    </View>
}

export default Confidentialitycenter;
